import ChatBar from "../components/ChatBar"
import messagePanel from "../components/messagePanel"

const Messanger = () => {
	return (
		<>
			<div className="ChatPage">
				<ChatBar />
				<messagePanel />
			</div>

		</>
	)
}
export default Messanger
